      & P\ar [r, "\pi _C"]\ar [d, "\pi _B"']\ar [dr, phantom, "\lrcorner ", very near start] & C\ar [d, "g"] \\
      & B\ar [r, "f"'] & A\makebox [0pt][l]{,}
    \end {tikzcd}


 but h and k both do so, so h = k.

